import React from 'react'
import incicleLogo from '../resurces/incicleLogo.png'

export function Header() {
  return (
    <>
      <div className='header'>
        <div className='logo'>
          <img src={incicleLogo} alt='logo' />
        </div>
      </div>
    </>
  )
}
